In ALTER EGO #121, the Golden Age JUSTICE SOCIETY returns! Their kith and kin talk about JSA creators JOHN B. WENTWORTH (Johnny Thunder), LEN SANSONE (The Atom), and BERNARD SACHS (who inked ARTHUR PEDDY's pencils on entire issues of All-Star Comics)! Plus rare art by CARMINE INFANTINO, PAUL REINMAN, MART NODELL, STAN ASCHMEIER, BEN FLINTON, H.G. PETER, and others! Also: FCA (Fawcett Collectors of America), MICHAEL T. GILBERT in Mr. Monster's Comic Crypt, and more! Cover homage by SHANE FOLEY to a vintage All-Star image by IRWIN HASEN! Edited by ROY THOMAS.

